    private void annutboqua(xNet.HttpRequest request, string cookie, string fb_dtsg, string jazoest, string nh)
    {
        try
        {
            for (int num = 0; num < cookie.Split(';').Length; num++)
            {
                try
                {
                    string key = cookie.Split(';')[num].Split('=')[0].Trim();
                    string value = cookie.Split(';')[num].Substring(cookie.Split(';')[num].IndexOf('=') + 1).Trim();
                    if (request.Cookies.ContainsKey(key))
                    {
                        request.Cookies.Remove(key);
                    }
                    request.Cookies.Add(key, value);
